import React from "react";
import ReactDom from "react-dom";

const data = [
  {
    title: "Code Coding Computer Data Developing Development",
    image: "https://placedog.net/500/280",
    user: "Nature Code",
    views: "22k",
    published: "9 months",
    avatar: "https://placedog.net/210/167",
  },
  {
    title: "Code Coding Computer Data Developing Development",
